import React from 'react'

function Nav() {
  return (
    <div className='nav-container'>
        <ul className='nav-list'>
            <li className='nav-item'><button>Home</button></li>
            <li className='nav-item'><button>New</button></li>
        </ul>
    </div>
  )
}

export default Nav
